import Layout from "../../components/layout";
import { useMemo, useEffect, useState } from "react";
import { API } from "aws-amplify";
import { listVendors } from "../../../src/graphql/queries.ts";
import Link from "next/link";
import Table from "../../components/table";

const Vendors = () => {
  const [vendors, setVendors] = useState([]);

  useEffect(() => {
    getAllVendors();
  }, []);

  const getAllVendors = async () => {
    const vendors = await API.graphql({
      query: listVendors,
    });

    setVendors(vendors.data?.listVendors.items);
  };

  const columns = useMemo(
    () => [
      {
        Header: "Vendor #",
        accessor: "vendorNumber",
      },
      {
        Header: "Company Report Name",
        accessor: "companyReportName",
      },
      {
        Header: "Company Listing Name",
        accessor: "companyListingName",
      },
      {
        Header: "Address 1",
        accessor: "address1",
      },
      {
        Header: "Address 2",
        accessor: "address2",
      },
      {
        Header: "City",
        accessor: "city",
      },
      {
        Header: "State",
        accessor: "state",
      },
      {
        Header: "Zip",
        accessor: "zipCode",
      },
      {
        Header: "Phone",
        accessor: "telephoneNum",
      },
      {
        Header: "Attention",
        accessor: "attention",
      },
      {
        Header: "Pre-Payment",
        accessor: "prepayment",
      },
      {
        Header: "Pre-Pay Amount",
        accessor: "prepaymentAmt",
      },
      {
        Header: "Edit",
        accessor: "id",
        Cell: ({ value }) => (
          <Link href="/vendors/edit/[id]" as={`/vendors/edit/${value}`}>
            <a className="text-blue-600 underline hover:text-blue-800 hover:no-underline">
              {" "}
              View
            </a>
          </Link>
        ),
      },
    ],
    []
  );

  return (
    <Layout>
      <div className="px-6">
        <div>
          <h3>Vendors</h3>
        </div>
        <div>
          <Link href="/vendors/create">
            <a>Create New</a>
          </Link>
        </div>
        <div>
          <Table data={vendors} columns={columns} />
        </div>
      </div>
    </Layout>
  );
};

export default Vendors;
